import React from 'react';
import '../App.css';
import "./Services.css";
import { Button } from '../components/Button.js';


const Services = () => {
  return (
    <div className="services">
      <div className="services-child" />
      <div className="services-item" />
      <div className="services-inner" />
      <b className="from">FROM</b>
      <input type='text' className='service1' placeholder='Enter location' />
      <b className="to">TO</b>
      <input type='text' className='service2' placeholder='Enter location' />
      <b className="date">DATE</b>
      <input type='date' className='service3' placeholder='date' />
      <div className="search">SEARCH</div>
      <div className="need">
        <Button className='need-companion' buttonSize='btn--large'>NEED COMPANION</Button>
      </div>
      <div className="be">
        <Button href="/needcompanion" className="be-a-companion" buttonSize='btn--large'>BE A COMPANION</Button>
      </div>
      </div>
  );
};

export default Services;
